import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Navbar from './components/Navbar';

import Login from './components/Login';
import Doglist from './components/Doglist';
import Dogdetails from './components/Dogdetails';
import Dograting from './components/Dograting';
import Superwaglist from './components/Superwaglist';
import Sharelink from './components/Sharelink';

function App() {
  return (
    <Router>
      <div>
        <Navbar />
        <Route path="/" exact component={Login} />
        <Route path="/dogs" exact component={Doglist} />
        <Route path="/dogs/:id" component={Dogdetails} />
        <Route path="/rate" component={Dograting} />
        <Route path="/superwag" component={Superwaglist} />
        <Route path="/share/:id" component={Sharelink} />
        <Footer />
      </div>
    </Router>
  );
}

export default App;
